import React, { Fragment } from 'react';
import "./styles.css";
import { Container, Row, Col, Card, CardHeader, CardBody } from "reactstrap";
import Breadcrumb from '../../../../../layout/breadcrumb';

const ManageVariousVideoCallsHelper = (props) => {
    return (
        <Fragment>
            <Breadcrumb parent="Manage Your Video Related Calling Data!" title="Video Interview Invite's, Cancel/Manage Pending Calls & More.."/>
            <Container fluid={true}>
                <Row>
                    <Col sm="12" md="12" lg="12" xl="12">
                        <Card className={"shadow"}>
                            <CardHeader className={"b-l-info b-r-info"}>

                            </CardHeader>
                            <CardBody>
                                <h1>ManageVariousVideoCallsHelper helper...!</h1>
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}

export default ManageVariousVideoCallsHelper;
